import React, { Component } from 'react';
import Search from '../../components/ProfileBlocks/Search/Search.js';
import ProfileBlocks from '../../components/ProfileBlocks/Student/ProfileBlocks.js';
import BasePage from '../../pages/BasePages/BasePage.js';


export default class ProfileStudent extends Component {

  componentDidMount() {
    document.title = "Профиль";
  }

  render() {
    const studentData=this.props.studentData
    const schedule_stud_prof=this.props.schedule_stud_prof

    return (
      <BasePage isAuthenticated={true} data={studentData}>
        <Search />
        <ProfileBlocks studentData={studentData} schedule_stud_prof={schedule_stud_prof}/>
        </BasePage>
    );
  }
}
